The '''Melbourne Victory Womens Football Club''' are an Australian women's association football club affiliated with [[Melbourne Victory FC]]. Founded in 2008 this team represents [[Melbourne]] in the Australian Women's National [[Association Football|football (soccer)]] League, the [[W-League (Australia)|W-League]].

[[Image:Melbourne Victory W-League V CCM W-League .JPG|250px|right|thumb||CCM W-League V Melbourne Victory W-League at Leichhardt Oval]]

